    private static boolean mayBeStatement(com.google.javascript.rhino.Node n) {
        switch (n.getType()) {
            case Token.EMPTY :
            case Token.FUNCTION :
                return true;
            case Token.BLOCK :
            case Token.BREAK :
            case Token.CONST :
            case Token.CONTINUE :
            case Token.DEBUGGER :
            case Token.DO :
            case Token.EXPR_RESULT :
            case Token.FOR :
            case Token.IF :
            case Token.LABEL :
            case Token.RETURN :
            case Token.SWITCH :
            case Token.THROW :
            case Token.TRY :
            case Token.VAR :
            case Token.WHILE :
            case Token.WITH :
                return true;
            default :
                return false;
        }
    }

